export default function(){
    const allPosts =()=>{
        const arrayPosts=[];
        const fetchPosts = async () =>{
            const response = await fetch('https://jsonplaceholder.typicode.com/posts');
            const data = await response.json();  
            
            arrayPosts.value=data;
        };
        fetchPosts()
        return arrayPosts;
    }
}
